import React from 'react';
import Detail from './component/DetailPokemon/DetailPokemon';
import './app.css'
import {BrowserRouter as Router, Switch, Route} from 'react-router-dom'
import Login from './component/Login/Login';
import Header from './page/Header/Header';
import Home from './component/Layouts/HomeLayout';
import Ability from './component/Layouts/AbilityLayout';
import Type from './component/Layouts/TypeLayout';
import Habitat from './component/Layouts/HabitatLayout';
import Sidebar from './page/Sidebar/Sidebar';
function App() {
  return (
    <Router>
    <Header/>
    <sidebar/>
    <Switch>
        <Route
          path='/'
          exact
          render={props => 
            <Home {...props}/>
          }
        />
        <Route path='/login' exact>
          <Login/>
        </Route>
        <Route
            path='/pokemon/:id'
            exact
            render={props => 
              <Detail {...props}/>
            }
          />
        <Route
            path='/ability/:id'
            exact
            render={props => 
              <Ability {...props}  />
            }
          />
        <Route
          path='/type/:id'
          exact
          render={props => 
            <Type {...props} />
          }
        />
        <Route
          path='/habitat/:id'
          exact
          render={props => 
            <Habitat {...props}/>
          }
        />
      </Switch>
    </Router>
  )
}

export default App;
